      /*+ ordered
          use_nl_with_index(oi)
          use_nl_with_index(i) index(i I_WRI$_OPTSTAT_IND_OBJ#_ST)
          OPT_PARAM(''''_parallel_syspls_obey_force'''' ''''false'''')
       */
      U.NAME, OI.NAME, OI.SUBNAME, NULL, NULL, NULL, NULL, NULL,
      BITAND(I.FLAGS, 2), 
      BITAND(I.FLAGS, 1), 
      I.ROWCNT, I.LEAFCNT, I.DISTKEY, I.LBLKKEY, I.DBLKKEY, I.CLUFAC,
      I.BLEVEL, I.ANALYZETIME, I.SAMPLESIZE, I.GUESSQ,
      I.CACHEDBLK, I.CACHEHIT, I.LOGICALREAD, I.FLAGS
    FROM SYS.USER$ U, SYS.OBJ$ OI, SYS.WRI$_OPTSTAT_IND_HISTORY I
    WHERE
      U.NAME = OWNER AND OI.OWNER# = U.USER# AND
      OI.NAME = INDNAME AND
      OI.TYPE# IN (1, 20) AND 
      OI.OBJ# = I.OBJ# AND I.SAVTIME > AS_OF_TIME AND
      
      (FROM_TZ(CAST(OI.CTIME AS TIMESTAMP), OSTZHM) <= AS_OF_TIME OR
       
       
       EXISTS (SELECT NULL FROM SYS.WRI$_OPTSTAT_IND_HISTORY IB 
               WHERE IB.OBJ# = OI.OBJ# AND
                     NVL(IB.ANALYZETIME, IB.SAVTIME) <= AS_OF_TIME)
      ) AND
      I.SAVTIME =
        (SELECT /*+ no_unnest */
         MIN(IB.SAVTIME)
         FROM SYS.WRI$_OPTSTAT_IND_HISTORY IB WHERE IB.OBJ# = I.OBJ# AND
         IB.SAVTIME > AS_OF_TIME)  
    UNION ALL
    SELECT
      /*+ ordered
          use_nl_with_index(os)
          use_nl_with_index(isp)
          use_nl_with_index(op)
          use_nl_with_index(i) index(i I_WRI$_OPTSTAT_IND_OBJ#_ST)
       */
      U.NAME, OP.NAME, OP.SUBNAME, OS.SUBNAME, NULL, NULL, NULL, NULL, 
      BITAND(I.FLAGS, 2), 
      BITAND(I.FLAGS, 1), 
      I.ROWCNT, I.LEAFCNT, I.DISTKEY, I.LBLKKEY,
      I.DBLKKEY, I.CLUFAC,
      I.BLEVEL, I.ANALYZETIME, I.SAMPLESIZE,
      NULL,
      I.CACHEDBLK, I.CACHEHIT, I.LOGICALREAD, I.FLAGS
    FROM SYS.USER$ U, SYS.OBJ$ OS,
         SYS.INDSUBPART$ ISP, SYS.OBJ$ OP,
         SYS.WRI$_OPTSTAT_IND_HISTORY I
    WHERE
      U.NAME = OWNER AND OS.OWNER# = U.USER# AND
      OS.NAME = INDNAME AND  OS.TYPE# = 35 AND 
      OS.OBJ# = ISP.OBJ# AND
      ISP.POBJ# = OP.OBJ# AND OP.TYPE# = 20 AND
      ISP.OBJ# = I.OBJ# AND I.SAVTIME > AS_OF_TIME AND
      
      (FROM_TZ(CAST(OS.CTIME AS TIMESTAMP), OSTZHM) <= AS_OF_TIME OR
       
       
       EXISTS (SELECT NULL FROM SYS.WRI$_OPTSTAT_IND_HISTORY IB 
               WHERE IB.OBJ# = OS.OBJ# AND
                     NVL(IB.ANALYZETIME, IB.SAVTIME) <= AS_OF_TIME)
      ) AND
      I.SAVTIME =
        (SELECT /*+ no_unnest */
         MIN(IB.SAVTIME)
         FROM SYS.WRI$_OPTSTAT_IND_HISTORY IB WHERE IB.OBJ# = I.OBJ# AND
         IB.SAVTIME > AS_OF_TIME)  
    ORDER BY 1,2,3,4"SELECT /*+ rule 
               OPT_PARAM(''''_parallel_syspls_obey_force'''' ''''false'''') */
        ''''''"''''||UI.NAME||''''''"'''' IND_OWNER, ''''''"''''||OI.NAME||''''''"'''' IND_NAME,
        OI.OBJ# OBJ_NUM, NVL(PO.FLAGS,0) LOCALITY, I.PROPERTY IPROP,
        I.TYPE# ITYPE
    FROM
        SYS.USER$ UT, SYS.OBJ$ OT, SYS.IND$ I, SYS.OBJ$ OI,
        SYS.USER$ UI, SYS.PARTOBJ$ PO
    WHERE
        ((GLOBAL_IDX_ONLY IS NULL) OR
           (PO.FLAGS IS NULL) OR    
           (PO.FLAGS = 2)) AND      
        UT.NAME = WHOSE_TAB AND UT.USER# = OT.OWNER# AND
        OT.NAME = WHICH_TAB AND OT.TYPE# = 2 AND OT.OBJ# = I.BO# AND
        I.OBJ# = OI.OBJ# AND OI.OWNER# = UI.USER# AND
        I.OBJ# = PO.OBJ#(+)
