               WHERE O.OBJ#=AC.SYNOBJ#), OT.NAME),
      ''''DM_NESTED_CATEGORICALS'''', 4000,
      ''''DM_NESTED_NUMERICALS'''', 22,
      ''''DM_NESTED_BINARY_FLOATS'''', 4,
      ''''DM_NESTED_BINARY_DOUBLES'''', 8,
       0),
