  FROM SYS.COL$ C, SYS. ''"_CURRENT_EDITION_OBJ''" O, SYS.USER$ U,
       SYS.COLTYPE$ AC, SYS.TAB$ T, SYS.OBJ$ OT
  WHERE O.OBJ# = C.OBJ#
   AND O.OBJ# = T.OBJ#(+)
   AND O.OWNER# = U.USER#
   AND C.OBJ# = AC.OBJ#(+) AND C.INTCOL# = AC.INTCOL#(+)
   AND AC.TOID = OT.OID$(+)
   AND OT.TYPE#(+) = 13
   AND U.NAME = OWNNAME AND O.NAME = TABNAME"10"11"14"17"16"18"15"19"21"20"23"25"26"13"24"NAME"ATTR_TYPE"DATA_TYPE"DATA_LENGTH"DATA_PRECISION"DATA_SCALE"PROPERTIES"ATTR_SPEC"NULL_IND"3F0F624A37966C49781FCACB4B374698"e/U5OfRvTuC8kQ+mMzjVXQ=="7687A91D361D348068EF64834100E9E9"DD9A8CF10C9FBCBCE89830856C00B772"641BC4FD12A5A7C2CD6A291D6345914E"DBMS_STANDARD"786058A931992410243955AD2ACEF848"0F9719729C24D04D26013330EFCAD963"OBJ#"79DE8B06FABA75FA428D30C668FBE477"91FBE1F15894767B1D0DF45758F64E55"OWNER#"TYPE#"OID$"7C55061CA125692556FC7FB788549930"LENGTH"PRECISION#"SCALE"INTCOL#"CHARSETFORM"USER#"TOID"SYNOBJ#""');
         BSLN_VARIANCE_T(
         SS.METRIC_ID
        ,B.BSLN_GUID
        ,(CASE WHEN HOUR_OF_DAY IS NULL
               THEN (CASE WHEN DAY_NIGHT IS NULL
                          THEN BSLN.K_TIMEGROUPING_FIELD_X
                          ELSE BSLN.K_TIMEGROUPING_FIELD_N END)
               ELSE BSLN.K_TIMEGROUPING_FIELD_H END)||
         (CASE WHEN DAY_OF_WEEK IS NULL
               THEN (CASE WHEN WEEKDAY_WEEKEND IS NULL
                          THEN BSLN.K_TIMEGROUPING_FIELD_X
                          ELSE BSLN.K_TIMEGROUPING_FIELD_W END)
               ELSE BSLN.K_TIMEGROUPING_FIELD_D END) 
        ,(CASE WHEN HOUR_OF_DAY IS NULL
               THEN (CASE WHEN DAY_NIGHT IS NULL
                          THEN 24
                          ELSE 12 END)
               ELSE 1 END)*
         (CASE WHEN DAY_OF_WEEK IS NULL
               THEN (CASE WEEKDAY_WEEKEND 
                     WHEN BSLN.K_TIMEGROUP_FIELD_WE THEN 2
                     WHEN BSLN.K_TIMEGROUP_FIELD_WD THEN 5
                     ELSE 7 END)
               ELSE 1 END)         
        ,SUM(NUM_INTERVAL)         
        ,CASE WHEN SUM(SS.NUM_INTERVAL) > 1
              THEN (SUM(SS.SUM_SQUARES) - (SUM(SS.NUM_INTERVAL*SS.AVERAGE)*SUM(SS.NUM_INTERVAL*SS.AVERAGE))/SUM(SS.NUM_INTERVAL))/
                    (SUM(SS.NUM_INTERVAL)-1)
              ELSE 0 END           
        )
    FROM
         BSLN_BASELINES             B
        ,DBA_HIST_BASELINE_METADATA AB
        ,DBA_HIST_SNAPSHOT          SN
        ,DBA_HIST_DATABASE_INSTANCE DI
        ,DBA_HIST_SYSMETRIC_SUMMARY SS
        ,(SELECT
                 HOUR AS HOUR_OF_WEEK
                ,TRUNC(HOUR/24) AS DAY_OF_WEEK
                ,MOD(HOUR,24) AS HOUR_OF_DAY
                ,INTRADAY AS DAY_NIGHT
                ,EXTRADAY AS WEEKDAY_WEEKEND
            FROM
                 BSLN_TIMEGROUPS)   TG
   WHERE
         B.DBID             = DBID_IN
     AND B.AUTO_TIMEGROUP   = BSLN.K_YES
     AND AB.BASELINE_ID     = B.BASELINE_ID
     AND AB.DBID            = B.DBID
     AND AB.BASELINE_TYPE   = K_MOVING_WINDOW_TYPE
     AND SN.DBID            = B.DBID
     AND SN.BEGIN_INTERVAL_TIME >= COMPUTE_DATE_IN -
                                   LEAST(AB.MOVING_WINDOW_SIZE,K_DEDUCE_TIMEGROUP_MAXDAYS)
     AND DI.DBID            = SN.DBID
     AND DI.INSTANCE_NUMBER = SN.INSTANCE_NUMBER
     AND DI.STARTUP_TIME    = SN.STARTUP_TIME
     AND DI.INSTANCE_NAME   = B.INSTANCE_NAME
     AND SS.SNAP_ID         = SN.SNAP_ID
     AND SS.DBID            = SN.DBID
     AND SS.INSTANCE_NUMBER = SN.INSTANCE_NUMBER
     AND SS.GROUP_ID        = 2
     AND SS.METRIC_ID     IN (K_METRICID_PERFORMANCE
                             ,K_METRICID_DEMAND
                             ,K_METRICID_SHAPE)
     AND SS.BEGIN_TIME + (SS.END_TIME - SS.BEGIN_TIME)/2
                      BETWEEN COMPUTE_DATE_IN - LEAST(AB.MOVING_WINDOW_SIZE,K_DEDUCE_TIMEGROUP_MAXDAYS)
                          AND COMPUTE_DATE_IN
     AND TG.HOUR_OF_WEEK    = BSLN_INTERNAL.HOUR_OF_WEEK(SS.BEGIN_TIME + (SS.END_TIME - SS.BEGIN_TIME)/2)
  GROUP BY GROUPING SETS
  ((SS.METRIC_ID,B.BSLN_GUID,HOUR_OF_DAY,DAY_OF_WEEK),
   (SS.METRIC_ID,B.BSLN_GUID,HOUR_OF_DAY,WEEKDAY_WEEKEND),
   (SS.METRIC_ID,B.BSLN_GUID,HOUR_OF_DAY),
   (SS.METRIC_ID,B.BSLN_GUID,DAY_NIGHT,DAY_OF_WEEK),
